import { IS_LOGGED } from "../types";

const initState = {
  posts: [
    { id: "1", title: "Prvi", body: "ovo je test" },
    { id: "2", title: "Drugi", body: "test je ovo" },
    { id: "3", title: "Treci", body: "test " },
    { id: "4", title: "Cetvrti", body: "tovo" },
    { id: "5", title: "Peti", body: " je ovo" },
  ],
};

export const data = (state = initState, action) => {
  return state;
};

export const addQuote = (state = false, action) => {
  switch (action.type) {
    case "SET_QUOTE": {
      return action.data;
    }
    default:
      return state;
  }
};
